import React, { Fragment, Component } from 'react';
import ReactDOM from 'react-dom';
import { makeStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import FaceTwoToneIcon from '@material-ui/icons/FaceTwoTone';
import Paper from '@material-ui/core/Paper';
import ChildFriendlyTwoToneIcon from '@material-ui/icons/ChildFriendlyTwoTone';
import CakeTwoToneIcon from '@material-ui/icons/CakeTwoTone';
import MoreVertOutlinedIcon from '@material-ui/icons/MoreVertOutlined';
import MediaQuery from 'react-responsive';

const useStyles = makeStyles((theme) => ({
  icon: {
    '& svg': {
      fontSize: 25
    },
    '&:hover': {
      backgroundColor: 'transparent'
    }
  },
  menu: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'flex-end',
    '& > *': {
      margin: theme.spacing(1),
      height: theme.spacing(6),
    }
  }
}));

function SvgIconsSize() {
const classes = useStyles();
  return (
	<Fragment>
		<div>Device Test!</div>

                <MediaQuery maxDeviceWidth={1224}>
                </MediaQuery>
                <MediaQuery orientation='portrait'>
                </MediaQuery>
                <MediaQuery orientation='landscape'>
                </MediaQuery>
                <MediaQuery minResolution='2dppx'>
                </MediaQuery>
		<MediaQuery minDeviceWidth={1224}>
			<div className={classes.menu}>
			<Paper elevation={3} style={{display: 'flex', justifyContent:'flex-end'}}>
      				<IconButton className={classes.icon}>
					<ChildFriendlyTwoToneIcon />&nbsp;<strong><span style={{fontSize:'22px'}}>Service</span></strong>
					&nbsp;<MoreVertOutlinedIcon />&nbsp;
					<CakeTwoToneIcon />&nbsp;<strong><span style={{fontSize:'22px'}}>Product</span></strong>
					&nbsp;<MoreVertOutlinedIcon />&nbsp;
					<FaceTwoToneIcon />&nbsp;<strong><span style={{fontSize:'22px'}}>About Us</span></strong>&nbsp;	
      				</IconButton>
			</Paper>
			</div>
		</MediaQuery>
	</Fragment>
	);
}

ReactDOM.render(
  // Try changing to isLoggedIn={true}:
  <SvgIconsSize />,
  document.getElementById('root')
);
